function getTopNews() {
  return fetch("http://localhost:3000/api/v1/news/top");
}

const postRegister = (requestBody) => {
  return fetch("http://localhost:3000/api/v1/users/register", {
    method: "POST",
    headers: {
      "Content-type": "application/json",
    },
    body: JSON.stringify(requestBody),
  });
};
